import React, { useContext } from "react";
import FortniteContext from "../context/FortniteContext";

export default function Table() {
    const context = useContext(FortniteContext);
    const { usersDataOne, usersDataTwo } = context;
    return (
        <div className="table-container">
            <table>
                <thead>
                    <tr>
                        <th>Users : </th>
                        <th>{usersDataOne?.name}</th>
                        <th>{usersDataTwo?.name}</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>Level : </td>
                        <td style={{ padding: '0 0 0 0.5vw' }}>{usersDataOne?.account.level}</td>
                        <td>{usersDataTwo?.account.level}</td>
                    </tr>
                </tbody>
            </table>
        </div>
    )
}
